script:
reset();

const origin = {
  x: -16,
  y: 0,
  z: -16,
};
const size = {
  x: 32,
  y: 12,
  z: 32,
};

box(
  origin.x - 1, origin.y, origin.z - 1,
  size.x + 2, size.y + 1, size.z + 2,
  3
);
box(
  origin.x, origin.y, origin.z,
  size.x, size.y, size.z,
  1
);
box(
  origin.x + 1, origin.y + 1, origin.z + 1,
  size.x - 2, size.y - 2, size.z - 2,
  0
);
for (let i = 0; i < 3; i += 1) {
  box(
    origin.x - i,
    origin.y + 1,
    origin.z + size.z * 0.5 - 5,
    1, 8, 10,
    i === 0 ? 0 : (i === 1 ? 1 : 3)
  );
}

box(
  origin.x + 1, origin.y + size.y - 2, origin.z + 1,
  size.x - 2, 1, size.z - 2,
  (x, y, z) => (
    Math.abs(z) % 4 === 0 ? (
     Math.abs(x) % 4 === 0 ? 0 : 2
    ) : (
     Math.abs(x) % 4 === 0 ? 2 : 0
    )
  )
);

for (let i = 0; i < 4; i += 1) {
   const z = origin.z + size.z * 0.5 - 10 + i * 6;
   box(
    origin.x + size.x - 2,
    origin.y + 1,
    z - 1,
    1, 5, 4,
    1
  );
  box(
    origin.x + size.x - 2,
    origin.y + 1,
    z,
    2, 4, 2,
    0
  );
  for (let j = 0; j < 3; j += 1) {
    box(
      origin.x + size.x - 1 + j,
      origin.y + 6,
      z - 1,
      1, 1, 4,
      j === 0 ? 0 : (j === 1 ? 1 : 3)
    );
  }
}
